PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `Academic_Year` (
	`academic_year` YEAR,
	PRIMARY KEY (`academic_year`)
);
CREATE TABLE `exams` (
`Exam_Id` TEXT(100) NOT NULL DEFAULT '',
`ExamDate` DATE NOT NULL,
`ExamTotalMarks` DECIMAL NOT NULL,
`ExamWeightage` DECIMAL NOT NULL,
PRIMARY KEY (`Exam_Id`)
);
CREATE TABLE `Guardian` (`Guardian_ID` TEXT(100) NOT NULL DEFAULT '',`StudentID` TEXT(100) NOT NULL DEFAULT '',`GuardianName` TEXT(100) NOT NULL DEFAULT '',`GuardianRelation` TEXT(100) NOT NULL DEFAULT '',`GuardianContactNo` INT(10) NOT NULL,`GuardianQualification` TEXT(50) NOT NULL DEFAULT '',`GuardianOccupation` TEXT(50) NOT NULL DEFAULT '',`GuardianEmailID` TEXT(50) NOT NULL DEFAULT '',PRIMARY KEY (`Guardian_ID`));
CREATE TABLE `student` (
`studentid` VARCHAR(100) NOT NULL,
`studentname` VARCHAR NOT NULL,
`studentdob` DATE NOT NULL,
`age` INT NOT NULL,
`studentaddress` VARCHAR NOT NULL,
`gender` CHAR NOT NULL,
`classid` VARCHAR NOT NULL,
`academicyear` INT NOT NULL,
PRIMARY KEY (`studentid`)
);
CREATE TABLE `marks` (
`Exam_Id` TEXT(100) NOT NULL DEFAULT '',
`studentid` TEXT(100) NOT NULL DEFAULT '',
`Academic_Year` INT(100) NOT NULL,
`marks` INT(100) NOT NULL,
PRIMARY KEY (`Exam_Id`,`studentid`,`Academic_Year`)
);
COMMIT;
